import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Formação from './components/pages/Formação'; // Certifique-se de que a capitalização está correta
import Sobremim from './components/pages/Sobremim'; // Certifique-se de que a capitalização está correta
import ProjetosRealizados from './components/pages/Projetosrealizados'; // Certifique-se de que a capitalização está correta

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/sobremim' element={<Sobremim />} />
        <Route path='/formação' element={<Formação />} />
        <Route path='/Projetosrealizados' element={<ProjetosRealizados />} />
      </Routes>
    </Router>
  );
}

export default App;
